import React from 'react';
import { Card, Container, List } from '@mui/material';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Grid2 from '@mui/material/Unstable_Grid2/Grid2';

const Welcome = ({ nextStep }) => {
    return (
        console.log(nextStep),
        <Container>
            <Box>
                <Card sx={{ minWidth: 275, p: 2 }}>
                    <Typography variant="body2" gutterBottom>
                        In this assessment, we will ask you a series of questions to determine how well you are doing with Agile.
                    </Typography>

                    <Typography variant="h6" gutterBottom>
                        There are 3 steps:
                    </Typography>
                    <Typography variant="body2" gutterBottom>
                        <List>
                            <li>First, we will ask you some questions about your delivery frequency.
                            </li>
                            <li>Then we will ask you some questions about your business.
                            </li>
                            <li>And finally, we will ask you some questions about your processes.</li>
                        </List>



                    </Typography>
                </Card>
            </Box>
            <Box sx={{ textAlign: 'center', mt: 2 }}>
                <Button variant="contained" color="primary" type="button" onClick={nextStep}>
                    START
                </Button>
            </Box>
        </Container>
    );
};
export default Welcome;
